import React from 'react';
import { useParams } from 'react-router-dom'; // To access URL parameters

const EndScreen = () => {
    const { gameId } = useParams(); // Get gameId from URL parameter

    // Construct the URL for the game
    const gameUrl = `https://playwavelength.com/join/${gameId}`;

    return (
        <div className="end-screen container text-center mt-5">
            <h1>Thank You for Playing Wavelength!</h1>
            <p>Share this link with your friends</p>
            <a href={gameUrl} target="_blank" rel="noopener noreferrer">{gameUrl}</a>
        </div>
    );
};

export default EndScreen;
